def converToList(jsonData):
    lines = []
    counterDataMap = jsonData.get('data')
    for counterDataKey in counterDataMap:
        pmDataList = counterDataMap.get(counterDataKey).get('pmDataList')
        lines.extend([converToLine(value) for value in pmDataList])
    return lines
        
        
     
    
def converToLine(value):
    ret = str(value.get('dnId')) + ','
    ret += str(value.get('dbName')) + ','
    ret += str(value.get('retentionPolicyName')) + ','
    ret += str(value.get('counterId')) + ','
    
    if value.get('startTime') != None and value.get('timeZoneOffset')  != None and value.get('dstOffset') != None :
        ret += time.strftime("%Y-%m-%d %H:%M:%S", time.localtime(value.get('startTime') + value.get('timeZoneOffset') * 60 + value.get('dstOffset') * 60 + time.timezone)) + ','
    else:
        ret += ','
    ret += str(value.get('startTime')) + ','
    ret += str(value.get('timeZoneOffset')) + ','
    ret += str(value.get('dstOffset')) + ','
    
    if str(value.get('counterValue')) != '1.7976931348623157e+308':
        ret += str(value.get('counterValue')) + ','
    else:
        ret += ','
    
    if str(value.get('counterValue')) != '1.7976931348623157e+308':
        ret += str(value.get('counterValue')) + ''
    else:
        ret += ''
    
    return ret + '\n'
    
    
    
